import math

def find_matching_string(a_00, a_01, a_10, a_11):

    def is_square(integer):
        root = math.sqrt(integer)
        return int(root + 0.5) ** 2 == integer
    if not is_square(1 + 8 * a_00) and (not is_square(1 + 8 * a_11)):
        return 'Impossible'
    z = 1 + math.sqrt(1 + 8 * a_00)
    o = 1 + math.sqrt(1 + 8 * a_11)
    if z % 2 == 1 or o % 2 == 1:
        return 'Impossible'
    z = int(z / 2)
    o = int(o / 2)
    if a_00 == 0 and a_01 == 0 and (a_10 == 0):
        z = 0
    if a_11 == 0 and a_01 == 0 and (a_10 == 0):
        o = 0
    if z * o != a_01 + a_10:
        return 'Impossible'
    if z == 0 and o == 0:
        return '0'
    s = z * o
    ans = []
    while True:
        if s - z >= a_01:
            ans.append('1')
            s -= z
            o -= 1
        else:
            ans.append('0')
            z -= 1
        if z == 0 and o == 0:
            break
    return ''.join(ans)

